import React, { useRef } from "react";
import emailjs from "@emailjs/browser";
import "./Home.css";

const Home = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();
    emailjs
      .sendForm(
        "service_qompota",     // Your EmailJS Service ID
        "template_95iekz2",    // Your EmailJS Template ID
        form.current,
        "tkG-UJe02yYKmGQ-m"    // Your EmailJS Public Key
      )
      .then(
        () => {
          alert("✅ Subscription successful! Thank you.");
          form.current.reset();
        },
        () => {
          alert("❌ Something went wrong. Please try again.");
        }
      );
  };

  return (
    <div className="home-page">

      {/* ===== HERO SECTION ===== */}
      <section className="hero-section">
        <div className="hero-content">
          <h1>The Live Shopping Marketplace</h1>
          <p>Shop, sell, and connect around the things you love.</p>
          <button className="primary-btn">Shop Now</button>
        </div>
        <div className="hero-image">
          <img src="assets/Hero.png" alt="Live Shopping" />
        </div>
      </section>

      {/* ===== DISCOVER SECTION ===== */}
      <section className="discover-section">
        <div className="discover-image">
          <img src="assets/Hero2.jpeg" alt="Live Shopping Fun" />
        </div>
        <div className="discover-content">
          <h2>Join In the Fun</h2>
          <p>
            Take part in fast-paced auctions, incredible flash sales, live show
            giveaways, and so much more.
          </p>
          <button className="secondary-btn">Explore Now</button>
        </div>
      </section>

      {/* ===== CATEGORY SECTION ===== */}
      <section className="category-section">
        <div className="category-content">
          <h2>We’ve Got It All</h2>
          <p>
            Explore 250+ categories, including fashion, coins, sneakers, and
            collectibles. Find what you love, live!
          </p>
          <button className="secondary-btn">Start Shopping</button>
        </div>
        <div className="category-image">
          <img src="assets/c425.jpeg" alt="Exciting Shopping" />
        </div>
      </section>

      {/* ===== DEALS SECTION ===== */}
      <section className="deals-section">
        <div className="deals-content">
          <h2>Find Incredible Deals on Name Brands</h2>
          <p>
            From top brands to unique treasures — there’s a deal waiting for you
            every minute.
          </p>
          <button className="secondary-btn">Browse Deals</button>
        </div>
        <div className="deals-image">
          <img src="assets/images.png.png" alt="Amazing Deals" />
        </div>
      </section>

      {/* ===== SUBSCRIBE SECTION ===== */}
      <section className="subscribe-section">
        <h2>Stay in the Loop</h2>
        <p>Get updates on live shows, giveaways, and exclusive offers.</p>

        <form ref={form} onSubmit={sendEmail} className="subscribe-form">
          <input
            type="email"
            name="user_email"
            placeholder="Enter your email address"
            required
          />
          <button type="submit" className="primary-btn">Subscribe</button>
        </form>
      </section>
    </div>
  );
};

export default Home;
